from flask import Flask, request, send_file, jsonify
from flask_cors import CORS
import matplotlib
matplotlib.use('Agg')
import matplotlib.pyplot as plt
import numpy as np
import io
import base64
import black

app = Flask(__name__)
CORS(app)

image_error = ''

@app.route('/get-plot', methods=['POST'])
def get_plot():
    try:
        # Obtn el cdigo Python del cuerpo de la solicitud
        data = request.get_json()
        python_code = data.get('python_code', '')

        if not python_code:
            return jsonify({"image_base64": image_error, "message": "TU ABUELA"}), 400

        formatted_code = black.format_str(python_code, mode=black.Mode())

        # Dividir el cdigo en partes
        import_code = ""
        main_code = ""

        # Separar el cdigo en importaciones y cdigo principal
        lines = formatted_code.split('\n')
        inside_function = False

        for line in lines:
            if line.strip().startswith('import') or line.strip().startswith('from'):
                import_code += line + '\n'
            elif line.strip() == '' or (line.strip().startswith('def') or line.strip().startswith('class')):
                if inside_function:
                    import_code += line + '\n'
                else:
                    main_code += line + '\n'
            else:
                main_code += line + '\n'

        # Ejecutar el cdigo de importacin
        exec(import_code, globals())

        # Crear un espacio de nombres separado para el cdigo principal
        code_namespace = {}

        # Ejecutar el cdigo principal
        exec(main_code, globals(), code_namespace)

        # Generar la imagen del grfico
        img = io.BytesIO()
        plt.savefig(img, format='png')
        plt.close()
        img.seek(0)
        
        img_base64 = base64.b64encode(img.read()).decode('utf-8')
        print(img_base64)

        return jsonify({"image_base64": img_base64})

    except RuntimeError as re:
        print(f"Runtime error: {re}")
        print('ENTROOOOOOOOOO 1111111111')
        return jsonify({"image_base64": image_error}), 500

    except Exception as e:
        print(f"Exception error: {e}")
        print('ENTROOOOOOOOOO 2222222222')
        return jsonify({"image_base64": image_error, "message": "Incorrect Python syntax"}), 400

if __name__ == '__main__':
    app.run(debug=True)
